@import url('https://fonts.googleapis.com/css2?family=Alegreya:ital,wght@1,500&display=swap');
//para el banner de la galeria
@import url('https://fonts.googleapis.com/css2?family=Poppins:wght@500&display=swap');

$background: #d4d0ac;
$paragraph: #2a2a2a;
$button: #ff8e3c;
$button-text: #0d0d0d;
$headline: #292828;


//Sizes
$h1: 20px;
$h1-tablet-desktop: 30px;   

//letter-sizes
$tablet: 768px;
$desktop: 992px;

//backgraund article
$back-art-color: $background;


//margin nav
$margin-nav: 5px;

//font.family  h1, p, nav
$font-h1: 'Lobster', cursive;
$family-p: 'Architects Daughter', cursive;
$family-nav: 'Bebas Neue', cursive;
$family-h2-desk-description: 'Architects Daughter', cursive;
$font-galery-mb: 'Poppins', sans-serif;

// size paragraphs 
$size-p:12px;
$size-p-tablet: 18px; 
$size-p-desk: 32px;
$size-p-foot: 10px;


$size-nav: 12px; //size of nav
$size-nav-tablet: 22px; //size nav-tablet
$size-nav-desktop: 32px; //size-desktop

$align-p: justify;


//font-size
$family-h2:'Alegreya', serif; 
$size-h2-mobile: 14px;
$size-h2-tablet: 18px;
$size-h2-desk: 24px;
$size-h1-mobile: 20px;
$size-h1-desk: 55px;
$size-h1-tablet: 35px;
$size-h2-desk-description: 24px;
$size-h2-tb-description: 18px;
$size-p-foot-tablet:12px;
$size-p-foot-desk:17px;

